  apikey: '7e52f36374ba42f08d6eafb5b7b4492c'
});
class  App extends Component {
  constructor(){
    super();
    this.state={
      input: '',
    }
  }
   onInputChange = (event) => {
    console.log(event.target.value);
    // this.setState({input: event.target.value});
  }

  onTap = ()=>{
    console.log("CLICKED")
    app.models.predict('7e52f36374ba42f08d6eafb5b7b4492c').then(
      function (response){
        console.log(response)
      },
      function (err){

      }
      );
  }






  render() {
    return (
      <div className="App">
        <Prtls className="particles"/>
      <Navigation />
       <Logo />
       <Rank />
      <ImageLinkForm 
      onInputChange={this.onInputChange} 
      onTap={this.onTap} />
      <FaceRecognition />
    </div>
  );
}
}

export default App;
